import "./App.css";
import Search from "./components/Search";
import { useState } from "react";
import Results from "./components/Results";

function App() {
  const [photos, setPhotos] = useState([]);
  return (
    <div className="App">
      <Search setPhotos={setPhotos} />
      <Results photos={photos} />
    </div>
  );
}

export default App;
